import ReactDOM from "react-dom/client";

import './App.css';
import Post from "./Post"
import Header from "./Header"
import {Route, Routes} from "react-router-dom"

export default function App() {
  return (
    <Routes>
      <Route index element={
     <main>
        <Header />
        <Post />
        <Post />
        <Post />
     </main>
      } />
    </Routes>

    );
}
